import React from "react";
import "../App.css";
import "../styles/SidebarMenu.css";
import { Link } from "react-router-dom";

const SidebarMenu = (userState) => {
  const menu = [
    "공지사항",
    "즐겨찾기",
    "마이페이지",
    "문의하기",
    "마이 스탬프",
  ];
  const menuList = menu.map((item) => {
    return <h1>{item}</h1>;
  });
  return <div>{menuList}</div>;
};

export default SidebarMenu;
